Este es un soneto humorístico escrito por José Joaquín de Mora (1783-1864), escritor, educador y político español que vivió durante el siglo XIX. Mora fue un autor prolífico que escribió tanto poesía seria como humorística, y este soneto pertenece a su vertiente más lúdica.
